import React, {useState, useEffect} from 'react';
import Toggle from './Togglebutton';


function Diagnose(){

    const [data, setData] = useState([{}]);

    useEffect(() => {
        fetch('/sys').then(
            res => res.json()
        ).then(
            data => {
                setData(data)
                console.log(data)
            }
        )  
    }, [])


    return (
        <>
            <h1>Diagnosis results</h1>

            {
                (typeof data === "undefined") ? (
                    <p> Loading...</p>
                ) : (
                    data.map((item, i) => {
                        // console.log(item);
                        // <Toggle name={item} />
                        <p key={i}> {item}</p>
                    })
                )
            }
        </>
    );
}

export default Diagnose;
